import "../style/sidebar.css";

import React from 'react';
import {Link} from 'react-router-dom';

import Container from 'react-bootstrap/Container';

function highLightChoice(){
    const location = useLocation();
    let loc = location.pathname;
    if (loc === "/design-work") {
        return(
            "design"
        );
    }
}

const Navbar = () => (
    <>
        <div id = "border-make"></div>
            <Container id = "nav" className = "side-nav" fluid = {false}>
                <div id="add-padding">
                    <Link className="side-nav-custom" to="/engineering" id = {highLightChoice}>Engineering</Link>
                    <Link className="side-nav-custom" to="/design">Design</Link>
                </div>
            </Container>
    </>
);

export default Navbar;
